import React from "react";

const Showrombooks = (props) => {
    console.log("tuj", props)
    const divStyle = {
        border: '1px solid #ccc',
        padding: '20px',
        backgroundColor: '#f8f8f8',
        color: '#333',
    };

    const h2Style = {
        fontSize: '24px',
        marginBottom: '10px',
    };

    const pStyle = {
        fontSize: '16px',
    };

    const authorsStyle = {
        marginTop: '10px',
    };

    const ulStyle = {
        listStyleType: 'none',
        margin: '0',
        padding: '0',
    };

    const liStyle = {
        display: 'inline-block',
        backgroundColor: '#ccc',
        color: '#fff',
        padding: '5px 10px',
        borderRadius: '5px',
        marginRight: '5px',
    };
    return (
        <div style={{ display: "flex", flexDirection: "column", alignItems: "center", backgroundColor: "#f7f7f7", padding: "20px" }}>
            <h1 style={{ fontSize: "32px", margin: "20px 0", color: "#333" }}>{mydata.searchname}</h1>
            <p style={{ fontSize: "18px", textAlign: "center", maxWidth: "600px", color: "#666" }}>{mydata.abstract}</p>
            <h2 style={{ fontSize: "24px", margin: "20px 0", color: "#333" }}>Books:</h2>
            <ul style={{ listStyle: "none", paddingLeft: 0 }}>
                {props.show.authors.map((author) => (
                    <li key={book} style={{ fontSize: "18px", marginBottom: "10px", color: "#666" }}>{book}</li>
                ))}
            </ul>
        </div>
    );
}

export default Showrombooks;
